    marginLeft: "0.5rem",
    border: " 1px blue solid",
    borderRadius: 4,
    width: "95%",
    padding: "1rem",
  };

  const paneDescriptionStyle = {
    width: "90%",
    margin: "0 auto",
  };

  const snippetPanelStyle = {
    border: "blue solid 1px",
    width: "95%",
    marginBottom: "0.5rem",
    boxShadow: "2px 2px 5px blue",
  };

